@hilaryknight and @jenni_hiirikoski continue to lead the way in women’s hockey, on the ice and off. Hilary set the record for all-time tournament goals with 47, and 🇺🇸 points record with 80 at this year’s #WomensWorlds. Jenni became the all-time record holder for most games played at the tournament with 75.
 
Congratulations to these two all-time competitors for continuing to build their legacy on the global stage.  #WomensMovementNeverStops
